    const [ number1, setNumber1] = useState(1)
    const [ number2, setNumber2] = useState(1)

    const handleClick = () => {
        if(number1 == number2) {
            alert('Você acertou o numero')

        }
    }
    return (
        <Body>
            <Main>
                <TextArea>
                    <N1>
                        <Text>{number} </Text>
                    </N1>
                    <TextInput value={number} onChangeText={(text) => {setNumber(text)}} />
                </TextArea>
                <Button title="Verificar" onPress={handleClick} />
            </Main>                
        </Body>

    )
}
